import React from "react";

const MonthStatsContainer = (props) => {
  const statsItems = [];
  console.log(props.stats);
  for (let stat in props.stats) {
    console.log(stat);
  }

  return (
    <div className="month-stats-container">
      <StatItem />
      <StatItem />

      <StatItem />
      <StatItem />
    </div>
  );
};

const StatItem = (props) => {
  return <div className="stat-item"></div>;
};

export default MonthStatsContainer;
